def cosine_sim(v1,v2):
    dot = np.dot(v1,v2) # Dot product of 2 vectors

    # Magnitude of each vector
    normv1 = np.linalg.norm(v1)
    normv2 = np.linalg.norm(v2)

    return dot / (normv1 * normv2)


def Mean_Absolute_Error(test,predicted):

    # For each test sample, calculated error using corresponding truth value and add it into err variable(Total Error). Then we divide err to sample number to obtain mean error.

    sample_num = len(test)
    err = 0
    for i in range(sample_num):
        err += np.abs(test[i] - predicted[i])

    err = err / sample_num
    return err

class KNN:
    def __init__(self,k):
        self.k = k # Neighbor number
        self.x = [] # Training data (Features)
        self.y = [] # Training data (Target)

    def train(self,train_x,train_y):
        # Setting train data

        self.x = np.array(train_x)
        self.y = np.array(train_y)

    def predict_Single(self,test_data): # Makes prediction for single data point

        # Started with empty similarities list.
        # Calculated similarities between test data and each training data.
        # Then sorted given similarities list to get most k similar train datas.
        # Finally, took the mean rate of the neighbor's as prediction.


        similarities = []
        for i in range(len(self.x)):
            sim = cosine_sim(test_data , self.x[i])
            similarities.append((sim,self.y[i]))



        similarities.sort(reverse=True)
        K_neighbors = similarities[:self.k]

        for j in range(len(K_neighbors)):
            print(f"{j+1}. Neighbor similarity score: {K_neighbors[j][0]}, Rating: {K_neighbors[j][1]}")

        predicted_Rating = 0
        for i in K_neighbors:
            predicted_Rating += i[1]

        predicted_Rating = predicted_Rating / self.k
        print(f"Predicted Rating: {predicted_Rating}")
        return predicted_Rating



    def predict(self,test_data):

        # Same process applied here. Only exception is this function takes list of test data as input instead of single point.

        Predictions = []

        for i in test_data:

            similarities = []
            for x_train,y_train in zip(self.x,self.y):
                sim = cosine_sim(i , x_train)
                similarities.append((sim,y_train))
            similarities.sort(reverse=True)
            K_neighbors = similarities[:self.k]

            ratings = [i for sim,i in K_neighbors]

            Predictions.append(np.mean(ratings))

        return Predictions




    def predict_Weighted(self,test_data):

        # Same process with predict function, only exception is weight function.
        # After defining k neighbor, calculated their weights (1 / (1-similarity)) and added it into weight_sum variable (initially 0)
        # Also calculated another variable using weight and rating (weight * rating), and added it into weighted_sum variable (initially 0)
        # For the prediction, used formula (weighted_sum / weight_sum).


        Predictions = []
        for i in test_data:

            similarities = []
            for j in range(len(self.x)):

                sim = cosine_sim(i,self.x[j])
                similarities.append((sim,self.y[j]))

            similarities.sort(reverse=True)
            K_neighbors = similarities[:self.k]

            weighted_sum = 0
            weight_sum = 0
            for j in K_neighbors:
                w = 1 / (1-cosine_sim(i,j[0]))
                weighted_sum += w * j[1]
                weight_sum += w
            prediction = weighted_sum / weight_sum
            Predictions.append(prediction)
        return Predictions

def K_fold_validation(k_neighbor,train_x,train_y,K_Fold = 5,weighted = False):

    # Get a number which divide dataset into 5 part.
    sub_size = math.ceil(len(train_x) / K_Fold)

    Errors = []
    for i in range(K_Fold):

        # For each iteration, take the i th subpart of the dataset as a test, others as a train.

        x ,y  = train_x,train_y

        # Taking i - i+1. fold as a test
        stest_x = x[i*sub_size : (i+1) * sub_size]
        stest_y = y[i*sub_size : (i+1) * sub_size]


        # Taking 0-i. folds  and i+1-(last_index) folds as a train
        strain1_x = x[ : i*sub_size]
        strain2_x = x[(i+1) * sub_size : ]

        strain1_y = y[ : i*sub_size]
        strain2_y = y[(i+1)*sub_size :]

        # Concatenated these two folds to obtain final train data for that iteration.
        strain_x = np.concatenate([strain1_x,strain2_x])
        strain_y = np.concatenate([strain1_y,strain2_y])



        # We set the model with the given neighbor number
        model = KNN(k = k_neighbor)
        model.train(train_x = strain_x,train_y = strain_y)

        # For given weighted parameter, predict function will be changed
        if(weighted):
            predictions = model.predict_Weighted(stest_x)
        else:
            predictions = model.predict(stest_x)


        # Error calculation
        err = Mean_Absolute_Error(stest_y,predictions)
        Errors.append(err)

        print(f"{i+1}. fold completed. Error: {err}")


    Mean_err = np.mean([i for i in Errors])


    print(f"Mean error: {Mean_err}")
    return np.mean(Mean_err)

